const Greeting = (props) => {

    const [hora, useHora] = useState( setInterval(() => {return props.date.toLocaleTimeString()}, 1000))

    return(
        <Fragment>
            <h1> Hola Forastero!</h1>
            <h2> Ahora mismo son las {hora} </h2>
        </Fragment>
    )
}

export default Greeting;
